public static Map<String, Object> getSortedKeysMap( Map<String, Object> valueMap )
    {
        Map<String, Object> map = new HashMap<>();

        for ( String key : valueMap.keySet() )
        {
            String sortKey = sortKey( key );

            if ( sortKey != null )
            {
                map.put( sortKey, valueMap.get( key ) );
            }
        }

        return map;
    }
